import React, { useState } from "react";
import axios from "axios";
import "./Weather.css";

import search_icon from "../Assets/search.png";
import clear_icon from "../Assets/clear.png";
import cloud_icon from "../Assets/cloud.png";
import drizzle_icon from "../Assets/drizzle.png";
import rain_icon from "../Assets/rain.png";
import snow_icon from "../Assets/snow.png";
import wind_icon from "../Assets/wind.png";
import humidity_icon from "../Assets/humidity.png";

const Weather = () => {
  let api_key = "e28b36a32d1041b6adbc18b037cc26e6";

  /*  Examples of API call:


     https://api.openweathermap.org/data/2.5/weather?q=Sydney&units=Metric&appid={API key}


  */

  const [wicon, setWicon] = useState(cloud_icon);

  const search = async () => {
    const element = document.getElementsByClassName("cityInput");
    if (element[0].value === "") {
      return 0;
    }

    let url = `https://api.openweathermap.org/data/2.5/weather?q=${element[0].value}&units=Metric&appid=${api_key}`;
    let response;

    try {
      response = await axios.get(url);
    } catch (error) {
      console.log(error);
    }

    let jsonData = await response.json();

    const humidity = document.getElementsByClassName("humidity-percent");
    const wind = document.getElementsByClassName("wind-rate");
    const temprature = document.getElementsByClassName("weather-temp");
    const location = document.getElementsByClassName("weather-location");

    humidity[0].innerHTML = jsonData.main.humidity + " %";
    wind[0].innerHTML = Math.ceil(jsonData.wind.speed) + " km/h";
    temprature[0].innerHTML = Math.floor(jsonData.main.temp) + " °C";
    location[0].innerHTML = jsonData.name;

    if (
      jsonData.weather[0].icon === "01d" ||
      jsonData.weather[0].icon === "01n"
    ) {
      setWicon(clear_icon);
    } else if (
      jsonData.weather[0].icon === "02d" ||
      jsonData.weather[0].icon === "02n"
    ) {
      setWicon(cloud_icon);
    } else if (
      jsonData.weather[0].icon === "03d" ||
      jsonData.weather[0].icon === "03n"
    ) {
      setWicon(drizzle_icon);
    } else if (
      jsonData.weather[0].icon === "04d" ||
      jsonData.weather[0].icon === "04n"
    ) {
      setWicon(drizzle_icon);
    } else if (
      jsonData.weather[0].icon === "09d" ||
      jsonData.weather[0].icon === "09n"
    ) {
      setWicon(rain_icon);
    } else if (
      jsonData.weather[0].icon === "10d" ||
      jsonData.weather[0].icon === "10n"
    ) {
      setWicon(rain_icon);
    } else if (
      jsonData.weather[0].icon === "13d" ||
      jsonData.weather[0].icon === "13n"
    ) {
      setWicon(snow_icon);
    } else {
      setWicon(clear_icon);
    }
  };

  return (
    <div className="container">
      <div className="top-bar">
        <input type="text" className="cityInput" placeholder="search" />
        <div
          className="search-icon"
          onClick={() => {
            search();
          }}
        >
          <img src={search_icon} alt="" className="search_icons" />
        </div>
      </div>
      <div className="weather-image">
        <img src={wicon} alt="" className="big_icons" />
      </div>
      <div className="weather-temp">24°C</div>
      <div className="weather-location">London</div>
      <div className="data-container">
        <div className="element">
          <img src={humidity_icon} alt="" className="icon small_icons" />
          <div className="data">
            <div className="humidity-percent">64%</div>
            <div className="text">Humidity</div>
          </div>
        </div>
        <div className="element">
          <img src={wind_icon} alt="" className="icon small_icons" />
          <div className="data">
            <div className="wind-rate">18 km/h</div>
            <div className="text">Wind Speed</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Weather;
